import React, { useState, useEffect } from 'react';
import { useTrans } from '../../../context/TransactionContext';

const baseBanks = { SBI: 0, AXIS: 0, IDBI: 0, MISC: 0 };

const monthsMap = {
  '01': 'Jan', '02': 'Feb', '03': 'Mar', '04': 'Apr',
  '05': 'May', '06': 'Jun', '07': 'Jul', '08': 'Aug',
  '09': 'Sep', '10': 'Oct', '11': 'Nov', '12': 'Dec'
};

function getFreshYearMap() {
  const monthObj = {};
  for (let i = 1; i <= 12; i++) {
    const num = i.toString().padStart(2, '0');
    const name = new Date(2000, i - 1).toLocaleString('en-US', { month: 'short' });
    monthObj[num] = [name, { ...baseBanks }];
  }
  return monthObj;
}

function Showsave({ data }) {
  const [duration, setDuration] = useState('monthly');
  const [view, setView] = useState('');
  const [selector, setSelector] = useState([]);
  const { trans } = useTrans();
  const [giveView, setGiveView] = useState({});

  const dataProcessing = () => {
    const yearMap = {};

    data.forEach(entry => {
      const year = entry.date.slice(0, 4);
      const month = entry.date.slice(5, 7);
      const bank = entry.category;
      const amount = Number(entry.deposit || 0);

      if (!yearMap[year]) {
        yearMap[year] = getFreshYearMap();
      }

      if (yearMap[year][month] && yearMap[year][month][1][bank] !== undefined) {
        yearMap[year][month][1][bank] += amount;
      }
    });

    setSelector(Object.entries(yearMap).sort((a, b) => b[0] - a[0]));
  };

  useEffect(() => {
    if (data && data.length > 0) {
      dataProcessing();
      setGiveView(selector[0]?.[1] || {});
    }
  }, [data, trans]);

  useEffect(() => {
    console.log('ðŸ“Š Final yearSelector:', selector);
    selector.forEach(element => {
      let ind = element[0];
      if (ind === view) {
        setGiveView(element[1]);
      }
    });
  }, [selector, view]);

  const runningTotal = { SBI: 0, AXIS: 0, IDBI: 0, MISC: 0 };

  return (
    <div>
      <h4>Saving Insight Summary</h4>

      <select value={view} onChange={(e) => setView(e.target.value)}>
        {
          selector.map((key, val) => (
            <option key={val} value={key[0]}>{key[0]}</option>
          ))
        }
      </select>

      <table>
        <thead>
          <tr>
            <th>Month</th>
            <th colSpan="3">SBI</th>
            <th colSpan="3">AXIS</th>
            <th colSpan="3">IDBI</th>
            <th colSpan="3">MISC</th>
          </tr>
          <tr>
            <th></th>
            <th>Added</th><th>Total</th><th>%Inc</th>
            <th>Added</th><th>Total</th><th>%Inc</th>
            <th>Added</th><th>Total</th><th>%Inc</th>
            <th>Added</th><th>Total</th><th>%Inc</th>
          </tr>
        </thead>
        <tbody>
          {
            Object.entries(giveView).map(([key, val], ind) => {
              const row = { month: val[0], ...val[1] };

              const rowData = ['SBI', 'AXIS', 'IDBI', 'MISC'].map(bank => {
                const added = row[bank];
                const newTotal = runningTotal[bank] + added;
                const percent = runningTotal[bank] === 0 ? 'âˆž%' : (((added / Math.abs(runningTotal[bank])) * 100).toFixed(1) + '%');
                const oldTotal = runningTotal[bank];
                runningTotal[bank] = newTotal;

                return [added, newTotal, percent];
              });

              return (
                <tr key={ind}>
                  <td>{row.month}</td>
                  {
                    rowData.flat().map((val, i) => (
                      <td key={i}>{val}</td>
                    ))
                  }
                </tr>
              );
            })
          }
        </tbody>
      </table>
    </div>
  );
}

export default Showsave;
